import React from 'react'
import { Button } from '@mui/material';
import { Link } from 'react-router-dom'

export default function Home() {
  return (
    <section>
        <h2>Home Page</h2>
        <Button component={Link} to="/about">
        Posts
      </Button>

    </section>
  )
}
